function CardMovie(props) {
  return (
    <a>
      <img alt={props.movie.image} src={props.movie.image} />

      <h2>{`${props.movie.title} ${props.movie.year}`}</h2>

      <p>{props.movie.phrase}</p>
      <link>{props.movie.audio}</link>
    </a>
  );
}

export default CardMovie;
